import ExpensItem from "./ExpensItems"


const ExpensesList=(props)=>{
   
    return 
    <ul className="expenses-list">
    {props.items.map((expense)=>(
     <ExpensItem
      key={expense.id}
      title={expense.title}
      amount={expense.amount} 
      date={expense.date}/>)
      )}
  </ul>
}
export default ExpensesList
